    "# Find markers for all clusters\n",
    "sc.markers <- FindAllMarkers(sc, \n",
    "                               only.pos = TRUE, \n",
    "                               min.pct = 0.25, \n",
    "                               logfc.threshold = 0.25)\n",
    "sc.markers %>% group_by(cluster) %>% top_n(n = 2, wt = avg_log2FC)"
   ]
